import gm_img from './assets/gm.jpg';
import './App.css';
import axios from "axios";
import React, { useState, useEffect, useRef } from "react";
import { Navbar, Button, Modal, Container, Col, Row, Card } from 'react-bootstrap';
import { BuyBox, HandleClickFashionBox } from './components/fashion-box/fashion-box-redux';
import ChatBox from './components/chat-box/chat-box';

function App() {
    return (
        <body>
            <Navbar bg="dark" data-bs-theme="dark">
                <Container>
                    <Navbar.Brand href="http://localhost:3000/"><b>楓之谷轉蛋模擬器</b></Navbar.Brand>
                </Container>
            </Navbar>
            <Navbar bg="light" data-bs-theme="dark">
                楓之谷轉蛋模擬器
            </Navbar>
            <div className='store-container'>
                <div className='buy-box'>
                    <BuyBox />
                </div>
                <div className='buy-box'>
                    <HandleClickFashionBox />
                </div>
                <div className='chat-box'>
                    <ChatBox />
                </div>

            </div>

        </body>
    )
}

export default App;
